import React from 'react';

import { FaTools,FaReact,FaCode } from 'react-icons/fa';
import { MdDevicesOther, } from 'react-icons/md';





const ProjectComponents =({icon,title,desc,direction, float,id}) => {



    return(

        <div className='ProjectCard' style={sProject} data-aos={`fade-${direction}`} data-aos-duration="1000">
            <div data-aos="zoom-in" data-aos-duration="1000">
                <div className="" ></div>
                <div className="sText">
                    <div className="skillIcon" >{(icon === 'FaReact' && <FaReact/>) || (icon === 'FaTools' && <FaTools/>) || (icon === 'MdDevicesOther' && <MdDevicesOther/>) || (icon === 'FaCode' && <FaCode/>) }</div>
                    <div className="skillTitle">{title}</div>
                    <div className="skillDesc">{desc}</div>
                </div>
                <div className="ProjectCardInner" style={{float:float}} id={id}></div>
            </div>

        </div>
    )
}

const sProject = {
    margin: '15px',
    width: '70%',
    height: 'auto',
    borderRadius: '15px',
    padding: '30px',
    transition: 'all .6s ease-out',
    boxShadow: '1px 1px 10px 1px rgba(0,0,0,0.20)',
}




export default ProjectComponents;
